) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;




DROP TABLE IF EXISTS eltern_codes;

CREATE TABLE `eltern_codes` (
  `codeID` int(11) NOT NULL AUTO_INCREMENT,
  `codeSchuelerAsvID` varchar(100) NOT NULL,
